import React, {Component} from 'react'

class PhotoFrame extends Component {
    render() {
        return(
            <div>
                {this.props.PhotoBlock.map((singlePhoto) => <Photo finalePhoto={singlePhoto} />)}

            </div>
        );
    }
}

export default PhotoFrame
